std::string WebFeatureToString(WebFeature value) {
  const char *str = WebFeatureToStringHelper(value);
  if (!str) {
    return base::StringPrintf("Unknown WebFeature value: %i", static_cast<int32_t>(value));
  }
  return str;
}

std::ostream& operator<<(std::ostream& os, WebFeature value) {
  return os << WebFeatureToString(value);
}

